import{_ as t,o as _,c as s,k as e,a as o}from"./chunks/framework.cc795e4d.js";const P=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"docs/糖尿病管理/并发症管理/糖尿病大血管病变/REWIND中与度拉糖肽和心血管事件相关的蛋白质生物标志物.md","filePath":"docs/糖尿病管理/并发症管理/糖尿病大血管病变/REWIND中与度拉糖肽和心血管事件相关的蛋白质生物标志物.md"}'),a={name:"docs/糖尿病管理/并发症管理/糖尿病大血管病变/REWIND中与度拉糖肽和心血管事件相关的蛋白质生物标志物.md"},n=e("h3",{id:"rewind中与度拉糖肽和心血管事件相关的蛋白质生物标志物",tabindex:"-1"},[o("REWIND中与度拉糖肽和心血管事件相关的蛋白质生物标志物 "),e("a",{class:"header-anchor",href:"#rewind中与度拉糖肽和心血管事件相关的蛋白质生物标志物","aria-label":'Permalink to "REWIND中与度拉糖肽和心血管事件相关的蛋白质生物标志物"'},"​")],-1),c=e("p",null,"礼来公司 Jonathan M Wilson博士",-1),i=e("p",null,"在REWIND试验中，与安慰剂(PL)相比，度拉糖肽(DU)降低了CV结局的风险（主要不良心血管事件[MACE]-3风险比 0.88）（图1）。为更好地了解DU如何降低CV风险，进行了与CV事件相关的循环蛋白及代谢生物标志物的事后分析。将907例MACE病例与907例非MACE对照匹配。采用免疫分析法测定血浆和血清中共19种蛋白生物标志物。首先通过将生物标志物从基线到治疗2年的变化的自然对数(ln)拟合到ANCOVA模型中，确定与DU相关的生物标志物。将识别的生物标志物拟合至 MACE病例/对照的logistic回归模型，以检验对CV结局的可能影响。结果发现4种生物标志物与DU相关：DU组的C反应蛋白(hsCRP)、N末端脑利钠肽激素原(NT-proBNP)和生长/分化因子-15(GDF-15)在2年内较PL组的增幅减弱，2年内C肽在 DU组较PL组的增幅更大。Logistic回归分析显示，hsCRP、NTproBNP和GDF-15增幅较小的患者发生MACE的可能性较小。C肽水平对MACE的发生无显著影响。",-1),r=e("p",null,[e("img",{src:"https://p.ipic.vip/87tpke.png",alt:"image-20231005150433957"})],-1),d=[n,c,i,r];function l(p,h,C,D,N,E){return _(),s("div",null,d)}const f=t(a,[["render",l]]);export{P as __pageData,f as default};
